import { TextField, Typography, colors } from "@mui/material";
import { Stack } from "@mui/system";
import React from "react";
const SigninForm = ({onSwitchMode }) => {
    return(
       <Stack justifyContent="center" alignItems="center" sx={{height:"100%",width:"100%",maxWidth:"700px",color:colors.grey[800]}}>
        <Stack spacing={5}>
            <Typography variant="h4" fontWeight={600} color={colors.grey[800]}>
                Welcome Back
            </Typography>
            <Typography color={colors.grey[600]}>
                Lorem ipsum dolor sit, amet consectetur adipisicing elit.
                </Typography>
        </Stack>
        <Stack spacing={4}>
            <Stack spacing={2}>
                <Stack spacing={1}>
                    <Typography color={colors.grey[800]}>Username</Typography>
                    <TextField/>
                    </Stack>
                    <Stack spacing={1}>
                    <Typography color={colors.grey[800]}>Password</Typography>
                    <TextField type="password"/>
                </Stack>
            </Stack>
        </Stack>
       </Stack>
    );
};
export default SigninForm;
